"use strict";
class MathUtil {
    static add(a, b) {
        return a + b;
    }
    static subtract(a, b) {
        return a - b;
    }
    static multiply(a, b) {
        return a * b;
    }
    static divide(a, b) {
        return a / b;
    }
}
console.log(MathUtil.add(1, 2));
console.log(MathUtil.subtract(1, 2));
console.log(MathUtil.multiply(1, 2));
console.log(MathUtil.divide(1, 2));
